    super(props)

    this.state = {
       data: 'loading'
    }
  }
  getData() {
    console.log('getData() called')
    setTimeout(() => {
        console.log()
        this.setState({
            data: 'loaded'
        })
    }, 3000)
 }

 componentDidMount() {
    this.getData()
 }

